import './App.css';
import Navbar from './components/Navbar'
import EmployeeInfo from './components/pages/employee_info';
import Login from './components/pages/login'

function App() {
  return (
  <div className='container'>
    <Router>
        <Navbar />
        <Switch>
          <Route path='/' exact component={Login} />
          <Route path='/employee_info' component={EmployeeInfo} />
          <Route path='/time_attendance' component={EmployeeInfo} />
          <Route path='/leave_app' component={EmployeeInfo} />
        </Switch>
      </Router>
  </div>

  );
}

export default App;
